    handleJstreeAjax = function() {
        $("#jstree-ajax").jstree({
            core: {
                themes: {
                    responsive: !1
                },
                check_callback: !0,
                data: {
                    url: function(e) {
                        // alert(e.id);
                        return "#" === e.id ? "treedata" :  e.original.file
                    },
                    data: function(e) {                                                
                            if("#" === e.id) 
                               return {   id: $('meta[name="root-id"]').attr('content') }
                            else 
                              return {    id:e.id } 
                       
                    },
                    dataType: "json"
                }
            },
            types: {
                "default": {
                    icon: "fa fa-user text-warning fa-lg"
                },
                file: {
                    icon: "fa fa-file text-warning fa-lg"
                }
            },
            plugins: ["dnd", "state", "types"]
        })
    },
    TreeView = function() {
        "use strict";
        return {
            init: function() {
               handleJstreeAjax()
            }
        }
    }();